  FormInput,
  FormButton,
  Text,
} from "./ReusmeElements";

const Reusme = () => {
  return (
    <>
      <Containner>
        <FormWrap>
          <Icon to="/">Googi</Icon>
          <FormContent>
            <Form action="#">
              <FormH1></FormH1>
            </Form>
          </FormContent>
        </FormWrap>
      </Containner>
      ;
    </>
  );
};

export default Reusme;
